property.value:
let fkAssociation = element.getStereotype("Foreign Key")?.getProperty("Association")?.getSelected();
let isFk = fkAssociation != null;
let isAutoGeneratedPk = element.hasStereotype('Primary Key') && element.getStereotype('Primary Key').getProperty('Data source')?.value !== "User supplied";

const nonGenParent = getFirstNonGeneralizationParent();
let isPartOfAssociation = (nonGenParent.specialization == "Association Target End" || nonGenParent.specialization == "Association Source End");

return (!isAutoGeneratedPk || isPartOfAssociation)
    // Entity Settings -> Ensure Private Property Settings != true
    && (application.getSettings("c4d1e35c-7c0d-4926-afe0-18f17563ce17")?.getField("0cf704e1-9a61-499a-bb91-b20717e334f5")?.value != "true")
    // mapping association is not to an Operation:
    && (lookup(mappingContext.targetElementId).specialization != "Operation")
    // if is FK under root class, include if is for aggregational relationahip:
    && (!isFk || element.getParent().specialization == "Class" || fkAssociation.getOtherEnd().typeReference.getIsCollection() || fkAssociation.getOtherEnd().typeReference.getIsNullable())
    && (element.getMetadata("set-by-infrastructure") != "true");

// This is to cater for inheritence, see below
function getFirstNonGeneralizationParent() {
  let p = element.getParent();

  // go up the heirarchy until the first non Generalization mapping
  while (p && p.specialization === "Generalization Target End") {
    p = p.getParent();
  }

  return p;
}

/*
Consider the following. On the Advanced Mapping Screen, the parent mapping doesn't go to "Attribute", it goes to "VariantAttribute",
however, the field mappings are under "Attribute". So when seeing if a specific field is mappable (Attribute.Id), we cannot
just check the parent (Attribute). We have to go up the tree to find the first non-generalization relationship - 
in this case, the mapping to VariantAttribute and check if it is mapped.

+------------------+
|   Attribute      |
+------------------+
| Id  (PK)         |
| Name             |
| Value            |
+------------------+
          ^
          | (inherits)
          |
+--------------------------+
|   VariantAttribute       |
+--------------------------+
| VariantId   (FK -> Variant.Id)
+--------------------------+

                * (many)
Variant (1)  ----------------->  VariantAttribute
                (1-to-many)

+------------------+
|    Variant       |
+------------------+
| Id               |
| Name             |
| SKU              |
+------------------+
*/

function isAggregateRoot(possibleAggrEntity) {
    let result = !possibleAggrEntity.getAssociations("Association")
        .some(x => x.isSourceEnd() && !x.typeReference.isCollection && !x.typeReference.isNullable);
    return result;
}

return !isAggregateRoot(element.typeReference.getType()) &&
    element.typeReference.isNavigable &&
    (
        (element.getOtherEnd().typeReference.getIsCollection() == false && element.getOtherEnd().typeReference.getIsNullable() == false)
        || application.isModuleInstalled("Intent.EntityFrameworkCore")
    )

