function isAggregateRoot(possibleAggrEntity) {
    let result = !possibleAggrEntity.getAssociations("Association")
        .some(x => x.isSourceEnd() && !x.typeReference.isCollection && !x.typeReference.isNullable);
    return result;
}

return element.getPackage().hasStereotype("Relational Database") &&
    element.typeReference.getType().getChildren("Attribute").some(x => x.hasStereotype("Primary Key")) &&
    isAggregateRoot(element.typeReference.getType());

const entity = element.getParent().typeReference.getType();
const keyAttr = entity
     .getChildren("Attribute")
     .filter(x => x.hasStereotype("Primary Key"))[0];

if (keyAttr == null) {
    return "<no key>";
}

const name = keyAttr.getName();
const type = keyAttr.typeReference.getType();
const typeStr = (type.getDisplay() + "[*]" ?? "no type");

return `${entity.getName()} ${pluralize(name)}: ${typeStr}`;

let model = element.typeReference.getType()
    .getChildren("Attribute")
    .filter(x => x.hasStereotype("Primary Key"))[0]
    ?.typeReference
    ?.toModel();
model.isCollection = true;
return model;

